import React from "react";

import { BrowserRouter, Switch, Route, Link, Router } from "react-router-dom";
import Home from "./Pages/Home/index";

const Root = () => {
  return (
    <Router>
      <Switch>
        <Route path='/' exact component={Home} />
      </Switch>
    </Router>
  );
};
export default Root;
